import React, {Component} from "react";
// import AddNumber from "../containers/AddNumber";
// import DisplayNumber from "../containers/DisplayNumber";
import TopLeft from "../containers/TopLeft";
import TopMid from "../containers/TopMid";
import TopRight from "../containers/TopRight";
import News from "../containers/News";
export default class AddNumberRoot extends Component{
    render(){
      return (
        <div>
            <div className="r-1 flex">
                <div className="c-1-1"><TopLeft/></div>
                <div className="c-1-2"><TopMid/></div>
                <div className="c-1-3"><TopRight/></div>
            </div>
            <div className="r-2 flex">
                <div className="c-2-1"><News/></div>
            </div>
            <div className="r-3 flex">
                <div className="c-3-1"></div>
                <div className="c-3-2">Group</div>
            </div>
            <div className="r-4 flex">
            <div className="c-4-1">Footer</div>
            </div>
        </div>

      )
    }
  }
